import React, { useEffect, useState } from 'react';
import axios from 'axios';
import ExerciseForm from './Components/ExerciseForm';
import ExerciseList from './Components/ExerciseList';
import 'bootstrap/dist/css/bootstrap.min.css';
import Swal from 'sweetalert2'
import withReactContent from 'sweetalert2-react-content'

function App() {
  const [exercises, setExercises] = useState([]);
  const [currentExercise, setCurrentExercise] = useState(null);
  const MySwal = withReactContent(Swal)

  useEffect(() => {
    fetchExercises();
  }, []);

  const fetchExercises = () => {
    axios.get('https://localhost:7165/api/Ejercicio')
      .then(response => {setExercises(response.data.myObject); console.log(response.data.myObject)})
      .catch(error => console.error('Error:', error));

  };

  const handleEdit = (exercise) => {
    console.log(exercise);
    setCurrentExercise(exercise);
  };

  const handleDelete = (id,exercise) => {
     Swal.fire({
    title: `Estas Seguro de elimnar ${exercise.nombreEjecicio} ?`,
    text: "No se podra Recuperar!",
    icon: "warning",
    showCancelButton: true,
    confirmButtonColor: "#3085d6",
    cancelButtonColor: "#d33",
    confirmButtonText: "Si, Eliminar!"
  }).then((result) => {
    if (result.isConfirmed) {     
      axios.delete(`https://localhost:7165/api/Ejercicio/${id}`, {
      }).then(response => {
          MySwal.fire({
            icon: "success",
            title: `<a>Se ha Eliminado Correctamente </strong></a>`,
            showConfirmButton: false,
            timer: 2500
          })
          fetchExercises();
          clearCurrentExercise();
      }).catch(error => {
          console.error('Error en la petici칩n:', error.response ? error.response.data : error);
          alert("Error en la solicitud. Revisa la consola para m치s detalles.");
      });
    }
  });

  };

  const clearCurrentExercise = () => {
    setCurrentExercise(null);
  };

  return (
    <div className="card text-center">
    <div className="card-header">
            <nav class="navbar bg-body-tertiary fixed-top">
          <div class="container-fluid">
            <a class="navbar-brand" href="#">Offcanvas navbar</a>
            <button class="navbar-toggler" type="button" data-bs-toggle="offcanvas" data-bs-target="#offcanvasNavbar" aria-controls="offcanvasNavbar" aria-label="Toggle navigation">
              <span class="navbar-toggler-icon"></span>
            </button>
            <div class="offcanvas offcanvas-end" tabindex="-1" id="offcanvasNavbar" aria-labelledby="offcanvasNavbarLabel">
              <div class="offcanvas-header">
                <h5 class="offcanvas-title" id="offcanvasNavbarLabel">Offcanvas</h5>
                <button type="button" class="btn-close" data-bs-dismiss="offcanvas" aria-label="Close"></button>
              </div>
              <div class="offcanvas-body">
                <ul class="navbar-nav justify-content-end flex-grow-1 pe-3">
                  <li class="nav-item">
                    <a class="nav-link active" aria-current="page" href="#">Home</a>
                  </li>
                  <li class="nav-item">
                    <a class="nav-link" href="#">Link</a>
                  </li>
                  <li class="nav-item dropdown">
                    <a class="nav-link dropdown-toggle" href="#" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                      Dropdown
                    </a>
                    <ul class="dropdown-menu">
                      <li><a class="dropdown-item" href="#">Action</a></li>
                      <li><a class="dropdown-item" href="#">Another action</a></li>
                      <li>
                        <hr class="dropdown-divider"/>
                      </li>
                      <li><a class="dropdown-item" href="#">Something else here</a></li>
                    </ul>
                  </li>
                </ul>
                <form class="d-flex mt-3" role="search">
                  <input class="form-control me-2" type="search" placeholder="Search" aria-label="Search"/>
                  <button class="btn btn-outline-success" type="submit">Search</button>
                </form>
              </div>
            </div>
          </div>
        </nav>
    </div>

          <ExerciseForm
            exerciseToEdit={currentExercise}
            refreshExercises={fetchExercises}
            clearEdit={clearCurrentExercise}
          />

          <ExerciseList
            exercises={exercises}
            onEdit={handleEdit}
            onDelete={handleDelete}
          />
      <div className="card-footer text-body-secondary">
        2 days ago
        </div>
    </div>
  );
}

export default App;
